import React from 'react';

function Header(props) {
    return <>
            <header>
            <div className="title">Memory</div>
            <div className="message">{props.message}</div>
            <div className="score">Score {props.score} of {props.total}</div>
            </header>
            <br/>
        </>
  }

  export default Header;
